import React, { Component } from 'react';
import './style.adminhome.css';

export const Admin = () => {

	return(
		<div class="flexbox-layout">
			<div class="navbar">
				<div>
					<h3 class="desktop-only-notice">Currently only supporting desktop</h3>
					<h1 class="title">PSPE Admin Portal</h1>
					<h3 class="username">Logged in as:</h3>
				</div>
				<div class="nav-element">
				</div>
			</div>
			<div  class="content">
				sdf
			</div>
		</div>

		);
}


export default Admin;
